### END PRECOMPUTED TABLES ###

puzzle_queue:		.space 400
puzzle_contact:		.space 200
			
d_puzzle_pending:	.word 0
d_solving_puzzle:	.word 0	    # nonzero when working on puzzle2

bot_on_left:		.word 0         # true if the bot is on the left side, false if bot is on the right side
useful_locations:	.space 13	# locations of each type of interesting tile (zero if absent on this side)
food_bin_tiles:		.space 4	# tile types of each food bin, from bottom to top (last is trash)

# constants for arctan
		    .align 4
PI:                 .float 3.14
three:              .float 3.0
five:               .float 5.0
F180:               .float 180.0

.text

# -----------------------------------------------------------------------
# main function - entry point
# -----------------------------------------------------------------------
main:
	# Construct interrupt mask
	li          $t4, 0
	or          $t4, $t4, BONK_INT_MASK		# request bonk
	or          $t4, $t4, REQUEST_PUZZLE_INT_MASK	# puzzle interrupt bit
        or          $t4, $t4, TIMER_INT_MASK		# enable timer interrupts
	or          $t4, $t4, 1				# global enable
	mtc0        $t4, $12
	
	# start generating the first puzzle
	la	$t0, puzzle1
	sw	$t0, REQUEST_PUZZLE

        # determine which side of the map we are on.
        lw          $t0, BOT_X
        slt         $t1, $t0, 150       # $t1 = BOT_X < 150 ? 1 : 0
        la          $t0, bot_on_left
        sw          $t1, 0($t0)    # save to global variable

        # fill tile_types
        la          $s0, map
        sw          $s0, GET_LAYOUT     # $s0 = struct layout {char map[15][15];};
	la	$s1, useful_locations
	la	$s2, food_bin_tiles
        beq     $t1, $zero, fill_right_tiles    # when bot_on_left is false, branch to fill_right_tiles

fill_left_tiles:
	li	$a0, 165
	li	$a1, 0
	jal	examine_location
        li	$a0, 105
	li	$a1, 1
	jal	examine_location
	li	$a0, 45
	li	$a1, 2
	jal	examine_location
	li	$a0, 32
	li	$a1, 3
	jal	examine_location
	li	$a0, 35
	jal	examine_location
	j	start_operations

fill_right_tiles:
	li	$a0, 179
	li	$a1, 0
	jal	examine_location
	li	$a0, 119
	li	$a1, 1
	jal	examine_location
	li	$a0, 59
	li	$a1, 2
	jal	examine_location
	li	$a0, 42
	li	$a1, 3
	jal	examine_location
	li	$a0, 39
	jal	examine_location
        # fall through
	
start_operations:
	lw	$t0, TIMER
	sw	$t0, TIMER	# immediately causes a timer interrupt, transfers control to kernel mode
	
infinite:
	lw	$t0, d_puzzle_pending		# will be set in kernel mode when puzzle is generated (not written yet)
	beq	$t0, $zero, infinite
	
	# figure out whether to use puzzle1 or puzzle2
	sw	$zero, d_puzzle_pending
	la	$a0, puzzle1			# puzzle to work on
	la	$s2, puzzle2			# puzzle to generate
	lw	$t3, d_solving_puzzle
	li	$t0, 1
	sw	$t0, d_solving_puzzle
	beq	$t3, $zero, use_puzzle1
	
	# reached only if d_solving_puzzle was 1
	move	$a0, $s2			# switch current and next
	la	$s2, puzzle1
	sw	$zero, d_solving_puzzle
	
	# skips to here if d_solving_puzzle was 0
use_puzzle1:
	sw	$s2, REQUEST_PUZZLE		# request the next puzzle (generated while solving this one)
	jal	puzzle_bolt			# solve the current puzzle
	sw	$a0, SUBMIT_SOLUTION		# submit the current solution - puzzle_bolt doesn't change $a0
	
	j	infinite
	
# -----------------------------------------------------------------------
# examine_location - updates useful_locations from the specified tile
# $a0: offset in layout array
# $s0: layout array base address
# $s1: useful_locations base address
# $s2: food_bin_tiles base address
# -----------------------------------------------------------------------

.globl examine_location
examine_location:
	add	$t0, $s0, $a0	# &map[tile]
	lbu	$t0, 0($t0)	# type = map[tile]
	add	$t1, $s1, $t0	# &useful_locations[type]
	sb	$a0, 0($t1)	# useful_locations[type] = tile
	add	$t1, $s2, $a1	# &food_bin_tiles[foodpos]
	sb	$t0, 0($t1)	# food_bin_tiles[foodpos] = type
	jr	$ra
	
# -----------------------------------------------------------------------
# optimized puzzle solving function
# -----------------------------------------------------------------------

.globl puzzle_bolt
puzzle_bolt:
        sub         $sp, $sp, 44	# free up registers to store:
        sw          $ra, 0($sp)	# &touchVert
        sw          $s0, 4($sp)	# scanStart
        sw          $s1, 8($sp)	# marker
        sw          $s2, 12($sp)	# Puzzle.Bitmap.Length
        sw          $s3, 16($sp)	# base address of the bitmap
	sw          $s4, 20($sp)	# qStart
	sw          $s5, 24($sp)	# qEnd
	sw          $s6, 28($sp)	# Puzzle.BytesWidth
	sw          $s7, 32($sp)	# how many bitmap bytes per row are valid
	sw          $gp, 36($sp)	# &transitions
	sw          $fp, 40($sp)	# &contact
	
	li	    $s0, 0		# scanStart = 0
	li	    $s1, 'A'	# marker
	li	    $s6, 5		# always 5 bytes - documentation is a lie
	la	    $ra, puzzle_touch_vert
	la	    $gp, puzzle_transition
	la	    $fp, puzzle_contact
	
	lw	    $t0, 4($a0)	# width
	and	    $t1, $t0, 7	# width & 0x7
	srl	    $s7, $t0, 3	# floor(width / 8)
	beq	    $t1, $zero, pb_no_ceil_needed
	add	    $s7, $s7, 1	# ceil(width / 8)
pb_no_ceil_needed:
	lw	    $t1, 0($a0)	# height
	mul	    $s2, $s6, $t1	# Puzzle.Bitmap.Length
	mul	    $s3, $t0, $t1	# width * height
	add	    $s3, $a0, $s3	# &puzzle->bitmap - 8
	add	    $s3, $s3, 8	# &puzzle->bitmap
	
pb_outer_loop_top:
	beq	    $s0, $s2, pb_outer_loop_done
	
	add	    $t0, $s3, $s0	# &puzzle->bitmap[scanStart]
	lbu	    $t0, 0($t0)	# chunk = puzzle->bitmap[scanStart]
	bne	    $t0, $zero, pb_start_fill
	add	    $s0, $s0, 1	# scanStart++
	j	    pb_outer_loop_top
	
pb_start_fill:
	la	    $t0, puzzle_contact	# zero out the contact array
	add	    $t1, $t0, 200
pb_clear_contact_top:
	beq	    $t0, $t1, pb_clear_contact_done
	sw	    $zero, 0($t0)
	sw	    $zero, 4($t0)
	sw	    $zero, 8($t0)
	sw	    $zero, 12($t0)
	sw	    $zero, 16($t0)
	add	    $t0, $t0, 20		# zero 5 words (20 bytes) per iteration
	j	    pb_clear_contact_top
	
pb_clear_contact_done:
	la	    $s4, puzzle_queue	# qStart = 0
	add	    $s5, $s4, 1		# qEnd = 1
	sb	    $s0, 0($s4)		# queue[0] = scanStart
	
pb_fill_loop_top:
	beq	$s4, $s5, pb_fill_loop_done
	lbu	$t5, 0($s4)	# position = queue[qStart]
	add	$t4, $s3, $t5	# &puzzle->bitmap[position]
	lbu	$t6, 0($t4)	# chunk = puzzle->bitmap[position]
	beq	$t6, $zero, pb_fill_loop_next
	
	add	$v0, $fp, $t5	# &contact[position]
	lbu	$t0, 0($v0)	# touching = contact[position]
	sll	$t1, $t6, 8	# chunk << 8
	or	$t1, $t1, $t0	# lookupId = chunk << 8 | touching
	add	$t0, $gp, $t1	# &transitions[lookupId]
	lbu	$t9, 0($t0)	# transitions[lookupId]
	beq	$t9, $t6, pb_fill_loop_next
	sb	$t9, 0($t4)	# puzzle->bitmap[position] = transitions[lookupId]
	
	div	$t5, $s6	# need both quotient and remainder
	mfhi	$t7		# position % Puzzle.BytesWidth
	beq	$t7, $s7, pb_fill_loop_next
	mflo	$t8		# position / Puzzle.BytesWidth
	sll	$t7, $t7, 3	# (position % Puzzle.BytesWidth) * 8
	lw	$t0, 4($a0)	# width
	mul	$t8, $t8, $t0	# (position / Puzzle.BytesWidth) * Puzzle.Width
	add	$t7, $t7, $t8	# mapPos
	
	nor	$t9, $t9, $t9	# ~transitions[lookupId]
	and	$t3, $t9, $t6	# changed = chunk & ~transitions[lookupId]
	and	$a2, $t3, 0x80	# nonzero if need to use touchLeft
	and	$a3, $t3, 0x01	# likewise for touchRight
	
	add	$a1, $ra, $t1	# &touchVert[lookupId]
	lbu	$a1, 0($a1)	# touchVert[lookupId]
	
	add	$t1, $a0, $t7	# &puzzle->map[mapPos] - 8
pb_write_map_top:
	beq	    $t3, $zero, pb_write_map_done
	and	    $t0, $t3, 0x7f	# see if cutting off the top bit changes the value
	beq	    $t3, $t0, pb_write_map_next
	sb	    $s1, 8($t1)	# puzzle->map[mapPos] = marker
pb_write_map_next:
	sll	    $t3, $t0, 1	# changed <<= 1
	add	    $t1, $t1, 1
	j	    pb_write_map_top
	
pb_write_map_done:
	# up
	sub	    $t1, $t5, $s6	# upPos = position - puzzle.BytesWidth
	blt	    $t1, $zero, pb_no_up
	lbu	    $t0, -5($t4)	# puzzle->bitmap[upPos]
	beq	    $t0, $zero, pb_no_up
	lbu	    $t3, -5($v0)	# contact[upPos]
	or	    $t3, $t3, $a1	# contact[upPos] | touchVert[lookupId]
	sb	    $t3, -5($v0)
	sb	    $t1, 0($s5)	# queue[qEnd] = upPos
	add	    $s5, $s5, 1	# qEnd++
	
pb_no_up:
	# down
	add	    $t8, $t5, $s6	# downPos = position + puzzle.BytesWidth
	bge	    $t8, $s2, pb_no_down
	lbu	    $t0, 5($t4)	# puzzle->bitmap[downPos]
	beq	    $t0, $zero, pb_no_down
	lbu	    $t3, 5($v0)	# contact[downPos]
	or	    $t3, $t3, $a1	# contact[downPos] | touchVert[lookupId]
	sb	    $t3, 5($v0)
	sb	    $t8, 0($s5)	# queue[qEnd] = downPos
	add	    $s5, $s5, 1	# qEnd++

pb_no_down:
	# left
	beq	    $a2, $zero, pb_no_left
	div	    $t5, $s6
	mfhi	    $t0		# position % Puzzle.BytesWidth
	beq	    $t0, $zero, pb_no_left
	lbu	    $t2, -1($t4)	# puzzle->bitmap[position - 1]
	beq	    $t2, $zero, pb_no_direct_left
	lbu	    $t3, -1($v0)	# contact[position - 1]
	or	    $t3, $t3, 1	# contact[position - 1] | touchLeft[lookupId]
	sb	    $t3, -1($v0)
	sub	    $t0, $t5, 1	# position - 1
	sb	    $t0, 0($s5)	# queue[qEnd] = position - 1
	add	    $s5, $s5, 1	# qEnd++
	
pb_no_direct_left:
	# down-left
	bge	    $t8, $s2, pb_no_down_left
	lbu	    $t0, 4($t4)	# puzzle->bitmap[downPos - 1]
	beq	    $t0, $zero, pb_no_down_left
	lbu	    $t3, 4($v0)	# contact[downPos - 1]
	or	    $t3, $t3, 1	# contact[downPos - 1] | touchLeft[lookupId]
	sb	    $t3, 4($v0)
	add	    $t0, $t5, 4	# downPos - 1
	sb	    $t0, 0($s5)	# queue[qEnd] = downPos - 1
	add	    $s5, $s5, 1	# qEnd++
	
pb_no_down_left:
	# up-left
	blt	    $t1, $zero, pb_no_left
	lbu	    $t0, -6($t4)	# puzzle->bitmap[upPos - 1]
	beq	    $t0, $zero, pb_no_left
	lbu	    $t3, -6($v0)	# contact[upPos - 1]
	or	    $t3, $t3, 1	# contact[upPos - 1] | touchLeft[lookupId]
	sb	    $t3, -6($v0)
	add	    $t0, $t5, -6	# upPos - 1
	sb	    $t0, 0($s5)	# queue[qEnd] = upPos - 1
	add	    $s5, $s5, 1	# qEnd++
	
pb_no_left:
	# right
	beq	    $a3, $zero, pb_no_right
	add	    $t6, $t5, 1	# position + 1
	div	    $t6, $s6
	mfhi	    $t0		# (position + 1) % Puzzle.BytesWidth
	beq	    $t0, $zero, pb_no_right
	lbu	    $t2, 1($t4)	# puzzle->bitmap[position + 1]
	beq	    $t2, $zero, pb_no_direct_right
	lbu	    $t3, 1($v0)	# contact[position + 1]
	or	    $t3, $t3, 0x80	# contact[position + 1] | touchRight[lookupId]
	sb	    $t3, 1($v0)
	sb	    $t6, 0($s5)	# queue[qEnd] = position + 1
	add	    $s5, $s5, 1	# qEnd++
	
pb_no_direct_right:
	# down-right
	bge	    $t8, $s2, pb_no_down_right
	lbu	    $t0, 6($t4)	# puzzle->bitmap[downPos + 1]
	beq	    $t0, $zero, pb_no_down_right
	lbu	    $t3, 6($v0)	# contact[downPos + 1]
	or	    $t3, $t3, 0x80	# contact[downPos + 1] | touchRight[lookupId]
	sb	    $t3, 6($v0)
	add	    $t0, $t5, 6	# downPos + 1
	sb	    $t0, 0($s5)	# queue[qEnd] = downPos + 1
	add	    $s5, $s5, 1	# qEnd++
	
pb_no_down_right:
	# up-right
	blt	    $t1, $zero, pb_no_right
	lbu	    $t0, -4($t4)	# puzzle->bitmap[upPos + 1]
	beq	    $t0, $zero, pb_no_right
	lbu	    $t3, -4($v0)	# contact[upPos + 1]
	or	    $t3, $t3, 0x80	# contact[upPos + 1] | touchRight[lookupId]
	sb	    $t3, -4($v0)
	add	    $t0, $t5, -4	# upPos + 1
	sb	    $t0, 0($s5)	# queue[qEnd] = upPos + 1
	add	    $s5, $s5, 1	# qEnd++
	
pb_no_right:
pb_fill_loop_next:
	add	    $s4, $s4, 1	# qStart++
	j	    pb_fill_loop_top
	
pb_fill_loop_done:
	add	    $s1, $s1, 1	# marker++
	j	    pb_outer_loop_top
	
pb_outer_loop_done:
        lw          $ra, 0($sp)
        lw          $s0, 4($sp)
        lw          $s1, 8($sp)
        lw          $s2, 12($sp)
        lw          $s3, 16($sp)
	lw          $s4, 20($sp)
	lw          $s5, 24($sp)
	lw          $s6, 28($sp)
	lw          $s7, 32($sp)
	lw          $gp, 36($sp)
	lw          $fp, 40($sp)
	add         $sp, $sp, 44
	jr	    $ra

	
	
	
#################
#               #
#  KERNEL MODE  #
#               #
#################

# NOTE: Only kernel mode is allowed to use floating-point operations!
	
.kdata
chunkIH:		.space 76
			.word 0xF1EE0801
kstack_top:		.space 1020
kstack_bottom:		.word 0
			.word 0xF1EE0802
			
OPQ_NOTHING		= 0	# no-op
OPQ_INITIAL_DOWN	= 1	# go down 2 tiles (from start)
OPQ_INITIAL_ENTRY	= 2	# angle down into the relevant rectangle
OPQ_STOP		= 3	# done moving for now
OPQ_GOTO_TILE		= 4	# drive to a useful tile type (high 24)
OPQ_GOTO_APPLIANCE_EDGE	= 5	# drive to an appliance tile (high 24) stopping at inner edge
OPQ_BOOST		= 6	# ensure enough boost for a time (high 24)
OPQ_FACE_APPLIANCE	= 7	# stop and look at the appliance
OPQ_FACE_BIN		= 8	# stop and look at the food bin
OPQ_DUMP		= 9	# drop off all items
OPQ_SIMPLE_PICKUP	= 10	# take from a bin or appliance
OPQ_GOTO_COUNTER	= 11	# go to the shared counter
OPQ_DROPOFF		= 12	# drop an item of the specified type (high 24)
OPQ_PROCESS		= 13	# wait for an item, if present, to wash or chop (20k cycles) to greater than the specified (high 24) prep level
OPQ_LOAD_UP		= 14	# pick up as much as possible from the current tile
OPQ_PROCESS_ASAP	= 15	# same as OPQ_PROCESS but will use instant finishing if possible
operations_queue:	.word OPQ_NOTHING OPQ_INITIAL_DOWN OPQ_INITIAL_ENTRY OPQ_STOP
			.space 512
			.word 0xF1EE0803
op_queue_pos:		.word 0
op_queue_length:	.word 4

			.align 4
			#       NOTHING   INITIAL_DOWN    INITIAL_ENTRY    STOP    GOTO_TILE    GOTO_APPLIANCE_EDGE BOOST    FACE_APPLIANCE    FACE_BIN    DUMP    SIMPLE_PICKUP    GOTO_COUNTER    DROPOFF    PROCESS    LOAD_UP    PROCESS_ASAP
od_jump_table:		.word	od_yes    od_initial_down od_initial_entry od_stop od_goto_tile od_goto_app_edge    od_boost od_face_appliance od_face_bin od_dump od_simple_pickup od_goto_counter od_dropoff od_process od_load_up od_process_asap
po_jump_table:		.word	po_done   po_initial_down po_initial_entry po_done po_goto_tile po_goto_app_edge    po_boost po_done           po_done     po_done po_done          po_goto_counter po_done    po_process po_done    po_process

# constants for each side, indexed with bot_on_left
entry_angles:		.word 110 70
bin_xs:			.word 279 20
bin_prox_xs:		.word 278 17
face_counter_angles:	.word 180 0
face_bin_angles:	.word 0   180
counter_prox_xs:	.word 158 139

boost_end_time:		.word 0		# cycle number at which last boost will end
food_bins_finished:	.word 0		# what index in food_bin_tiles we're currently taking raw ingredients from
placed_on_appliance:	.word 0		# whether the last OPQ_DROPOFF actually placed anything

non_intrpt_str:		.asciiz "Non-interrupt exception\n"
unhandled_str:		.asciiz "Unhandled interrupt type\n"

.ktext 0x80000180
interrupt_handler:
.set noat
        move	$k1, $at	# Save $at
.set at
        la	$k0, chunkIH
        sw	$a0, 0($k0)	# Get some free registers
        sw	$v0, 4($k0)	# by storing them to a global variable
        sw	$t0, 8($k0)
        sw	$t1, 12($k0)
        sw	$t2, 16($k0)
        sw	$t3, 20($k0)
	sw	$t4, 24($k0)
	sw	$t5, 28($k0)
	sw	$a1, 32($k0)
	sw	$a2, 36($k0)
	sw	$a3, 40($k0)
	sw	$v1, 44($k0)
	sw	$ra, 48($k0)
	sw	$sp, 52($k0)
	sw	$s0, 56($k0)
	sw	$s1, 60($k0)
	sw	$s2, 64($k0)
	
	# preserve HI and LO
	mflo	$t0
	sw	$t0, 68($k0)
	mfhi	$t0
	sw	$t0, 72($k0)

        mfc0	$k0, $13	# Get Cause register
        srl	$a0, $k0, 2
        and	$a0, $a0, 0xf	# ExcCode field
        bne	$a0, 0, ih_non_intrpt

ih_interrupt_dispatch:
        mfc0	$k0, $13		# Get Cause register, again
        beq	$k0, 0, ih_done		# handled all outstanding interrupts

        and	$a0, $k0, BONK_INT_MASK		# is there a bonk interrupt?
        bne	$a0, 0, ih_bonk_interrupt

        and	$a0, $k0, TIMER_INT_MASK	# is there a timer interrupt?
        bne	$a0, 0, ih_timer_interrupt

        and	$a0, $k0, REQUEST_PUZZLE_INT_MASK
        bne	$a0, 0, ih_request_puzzle_interrupt

        li	$v0, PRINT_STRING	# Unhandled interrupt types
        la	$a0, unhandled_str
        syscall
        j	ih_done
	
ih_bonk_interrupt:
	sw	$0, BONK_ACK
        j	ih_perform_operation

ih_request_puzzle_interrupt:
	sw	$zero, REQUEST_PUZZLE_ACK
	li	$t0, 1
	sw	$t0, d_puzzle_pending
	j	ih_interrupt_dispatch

ih_timer_interrupt:
	sw	$0, TIMER_ACK
        # fall through to ih_perform_operation
	
ih_perform_operation:
	la	$sp, kstack_bottom
	lw	$t0, op_queue_pos
	lw	$t1, op_queue_length
	bne	$t0, $t1, ih_queue_ready
	
	jal	fill_queue	# find some work to do
	lw	$t0, op_queue_length
	beq	$t0, $zero, ih_interrupt_dispatch
	li	$t0, 0		# start from the top of the queue
	
ih_queue_ready:
	sll	$t0, $t0, 2	# [opQueuePos]
	la	$t1, operations_queue
	add	$t1, $t1, $t0	# &opQueue[opQueuePos]
	lw	$s0, 0($t1)	# current operation
	srl	$a1, $s0, 8	# high bits (extra data)
	and	$a0, $s0, 0xFF
	jal	operation_done	# check whether a task was just completed
	beq	$v0, $zero, ih_operation_incomplete
	
	lw	$t0, op_queue_pos
	add	$t0, $t0, 1	# opQueuePos++
	sw	$t0, op_queue_pos
	j	ih_perform_operation
	
ih_operation_incomplete:
	srl	$a1, $s0, 8	# prepare arguments again
	and	$a0, $s0, 0xFF
	jal	perform_operation
	j	ih_interrupt_dispatch

ih_non_intrpt:			# was some non-interrupt
        li	$v0, PRINT_STRING
        la	$a0, non_intrpt_str
        syscall			# print out an error message
        # fall through to done

ih_done:
        la	$k0, chunkIH
	
	# restore HI and LO
	lw	$t0, 68($k0)
	mtlo	$t0
	lw	$t0, 72($k0)
	mthi	$t0
	
        lw	$a0, 0($k0)	# Restore saved registers
        lw	$v0, 4($k0)
        lw	$t0, 8($k0)
        lw	$t1, 12($k0)
        lw	$t2, 16($k0)
        lw	$t3, 20($k0)
        lw	$t4, 24($k0)
        lw	$t5, 28($k0)
	lw	$a1, 32($k0)
	lw	$a2, 36($k0)
	lw	$a3, 40($k0)
	lw	$v1, 44($k0)
	lw	$ra, 48($k0)
	lw	$sp, 52($k0)
	lw	$s0, 56($k0)
	lw	$s1, 60($k0)
	lw	$s2, 64($k0)
.set noat
        move	$at, $k1	# Restore $at
.set at
        eret

# -----------------------------------------------------------------------
# fill_queue - determines what the bot should work on next
# -----------------------------------------------------------------------

fill_queue:
	sub	$sp, $sp, 12
	sw	$ra, 0($sp)
	sw	$s0, 4($sp)	# stores new queue length
	sw	$s1, 8($sp)	# stores next free queue entry
	
	# clear the queue
	sw	$zero, op_queue_pos
	sw	$zero, op_queue_length
	li	$s0, 0
	la	$s1, operations_queue
	
	# see if we're nearing the end of the match
	lw	$t0, TIMER
	li	$t1, 9200000
	blt	$t1, $t0, fq_submission_time
	
	# see what's on the shared counter
	la	$a0, encoded_request
	sw	$a0, GET_SHARED
	la	$a1, decoded_request
	jal	decode_request_in_mem
	la	$t2, useful_locations
	la	$t3, decoded_request
	
fq_raw_top:
	# find the farthest bin that hasn't been adequately used
	lw	$t4, food_bins_finished
	beq	$t4, 3, fq_raw_done
	la	$t1, food_bin_tiles
	add	$t1, $t1, $t4	# &food_bin_tiles[food_bins_finished]
	lbu	$t1, 0($t1)	# bin tile to consider
	beq	$t1, T_BIN_BREAD, fq_try_bread
	beq	$t1, T_BIN_LETTUCE, fq_try_lettuce
	beq	$t1, T_BIN_CHEESE, fq_try_cheese
	beq	$t1, T_BIN_TOMATO, fq_try_tomato
	beq	$t1, T_BIN_ONION, fq_try_onion
	beq	$t1, T_BIN_MEAT, fq_try_meat
	j	fq_raw_done	# !!! didn't match any
	
fq_try_bread:
	lw	$t1, R_BREAD($t3)
	bge	$t1, 26, fq_raw_next
	li	$t1, 0x0704	# go to bread bin
	sw	$t1, 0($s1)
	li	$t1, OPQ_FACE_BIN
	sw	$t1, 4($s1)
	li	$t1, OPQ_LOAD_UP
	sw	$t1, 8($s1)
	li	$s0, 3		# three entries in queue
	add	$s1, $s1, 12
	j	fq_finish_to_counter
	
fq_try_cheese:
	lw	$t1, R_CHEESE($t3)
	bge	$t1, 4, fq_raw_next
	li	$t1, 0x0B04	# go to cheese bin
	sw	$t1, 0($s1)
	li	$t1, OPQ_FACE_BIN
	sw	$t1, 4($s1)
	li	$t1, OPQ_LOAD_UP
	sw	$t1, 8($s1)
	li	$s0, 3		# three entries in queue
	add	$s1, $s1, 12
	j	fq_finish_to_counter

fq_try_meat:
	lw	$t0, R_MEAT($t3)
	lw	$t1, R_UNCOOKED_MEAT($t3)
	add	$t0, $t0, $t1	# total meat on counter
	bge	$t0, 16, fq_raw_next
	li	$t0, 0x0804	# go to meat bin
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_BIN
	sw	$t0, 4($s1)
	li	$t0, OPQ_LOAD_UP
	sw	$t0, 8($s1)
	li	$s0, 3		# three entries in queue
	add	$s1, $s1, 12
	bne	$t4, 2, fq_finish_to_counter
	lbu	$t1, T_OVEN($t2)
	beq	$t1, $zero, fq_finish_to_counter
	
	li	$t0, 0x0404	# go to oven
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_APPLIANCE
	sw	$t0, 4($s1)
	add	$a0, $s1, 8
	li	$a1, 0x0200000C	# drop uncooked meat
	li	$a2, OPQ_PROCESS_ASAP
	jal	queue_process_four
	add	$s0, $s0, 14	# added 14 more
	add	$s1, $s1, 56
	j	fq_finish_to_counter
	
fq_try_onion:
	lw	$t0, R_ONIONS($t3)
	lw	$t1, R_UNCUT_ONIONS($t3)
	add	$t0, $t0, $t1	# total onions on counter
	bge	$t0, 10, fq_raw_next
	li	$t0, 0x0C04	# go to onion bin
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_BIN
	sw	$t0, 4($s1)
	li	$t0, OPQ_LOAD_UP
	sw	$t0, 8($s1)
	li	$s0, 3		# enqueued three items
	add	$s1, $s1, 12
	bne	$t4, 2, fq_finish_to_counter
	lbu	$t1, T_CHOPPING_BOARD($t2)
	beq	$t1, $zero, fq_finish_to_counter
	
	li	$t0, 0x0604	# go to chopping board
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_APPLIANCE
	sw	$t0, 4($s1)
	add	$a0, $s1, 8
	li	$a1, 0x0400000C	# drop unchopped onion
	li	$a2, OPQ_PROCESS
	jal	queue_process_four
	add	$s0, $s0, 14	# added 14 more
	add	$s1, $s1, 56
	j	fq_finish_to_counter
	
fq_try_tomato:
	lw	$t0, R_TOMATOES($t3)
	lw	$t1, R_UNWASHED_TOMATOES($t3)
	add	$t0, $t0, $t1	# total tomatoes on counter
	bge	$t0, 10, fq_raw_next
	li	$t0, 0x0A04	# go to tomato bin
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_BIN
	sw	$t0, 4($s1)
	li	$t0, OPQ_LOAD_UP
	sw	$t0, 8($s1)
	li	$s0, 3		# enqueued 3
	add	$s1, $s1, 12
	bne	$t4, 2, fq_finish_to_counter
	lbu	$t1, T_SINK($t2)
	beq	$t1, $zero, fq_finish_to_counter
	
	li	$t0, 0x0504	# go to sink
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_APPLIANCE
	sw	$t0, 4($s1)
	add	$a0, $s1, 8
	li	$a1, 0x0300000C	# drop unwashed tomato
	li	$a2, OPQ_PROCESS
	jal	queue_process_four
	add	$s0, $s0, 14
	add	$s1, $s1, 56
	j	fq_finish_to_counter
	
fq_try_lettuce:
	lw	$t0, R_LETTUCE($t3)
	lw	$t1, R_UNPROCESSED_LETTUCE($t3)
	add	$t0, $t0, $t1
	lw	$t1, R_UNWASHED_LETTUCE($t3)
	add	$t0, $t0, $t1	# total lettuce on counter
	bge	$t0, 14, fq_raw_next
	li	$t0, 0x0904	# go to lettuce bin
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_BIN
	sw	$t0, 4($s1)
	li	$t0, OPQ_LOAD_UP
	sw	$t0, 8($s1)
	li	$s0, 3		# enqueued 3
	add	$s1, $s1, 12
	bne	$t4, 2, fq_finish_to_counter
	lbu	$t1, T_SINK($t2)
	beq	$t1, $zero, fq_finish_to_counter
	
	li	$t0, 0x0504	# go to sink
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_APPLIANCE
	sw	$t0, 4($s1)
	add	$a0, $s1, 8
	li	$a1, 0x0500000C	# drop unwashed lettuce
	li	$a2, OPQ_PROCESS
	jal	queue_process_four
	add	$s0, $s0, 14	# added 14 more
	add	$s1, $s1, 56
	lbu	$t1, T_CHOPPING_BOARD($t2)
	beq	$t1, $zero, fq_finish_to_counter
	
	li	$t0, 0x0604	# go to chopping board
	sw	$t0, 0($s1)
	li	$t0, OPQ_FACE_APPLIANCE
	sw	$t0, 4($s1)
	add	$a0, $s1, 8
	li	$a1, 0x0500010C	# drop washed lettuce
	li	$a2, 0x010D	# process to level 2
	jal	queue_process_four
	add	$s0, $s0, 14	# added 14 more
	add	$s1, $s1, 56
	j	fq_finish_to_counter
	
fq_finish_to_counter:
	li	$t0, OPQ_GOTO_COUNTER
	sw	$t0, 0($s1)
	li	$t0, OPQ_DUMP
	sw	$t0, 4($s1)
	add	$s0, $s0, 2
	sw	$s0, op_queue_length
	j	fq_done

fq_raw_next:
	lw	$t0, food_bins_finished
	add	$t0, $t0, 1
	sw	$t0, food_bins_finished
	j	fq_raw_top
	
fq_raw_done:
	
fq_submission_time:
	# TODO
	
fq_done:
	lw	$ra, 0($sp)
	lw	$s0, 4($sp)
	lw	$s1, 8($sp)
	add	$sp, $sp, 12
	jr	$ra
	
# queue_process_four enqueues four dropoff/process/pickup cycles
# always advances 12 entries
# trashes $t0 and $v0 but leaves all other registers intact
# $a0: first empty queue address
# $a1: drop command
# $a2: process command (either OPQ_PROCESS or OPQ_PROCESS_ASAP)

queue_process_four:
	li	$t0, OPQ_LOAD_UP
	sw	$a1, 0($a0)
	sw	$a2, 4($a0)
	sw	$t0, 8($a0)
	sw	$a1, 12($a0)
	sw	$a2, 16($a0)
	sw	$t0, 20($a0)
	sw	$a1, 24($a0)
	sw	$a2, 28($a0)
	sw	$t0, 32($a0)
	sw	$a1, 36($a0)
	sw	$a2, 40($a0)
	sw	$t0, 44($a0)
	jr	$ra
	
# -----------------------------------------------------------------------
# operation_done - determines whether a queue item has been completed
# $a0: operation ID from queue (low 16 bits)
# $a1: extra data
# $v0: nonzero if task is complete and should be dequeued
# -----------------------------------------------------------------------

operation_done:
	sub	$sp, $sp, 4
	sw	$ra, 0($sp)

	la	$t0, od_jump_table
	sll	$t1, $a0, 2	# [i]
	add	$t0, $t0, $t1	# address in jump table to load
	lw	$t0, 0($t0)	# subfunction address
	jr	$t0
	
od_initial_down:
	lw	$t0, BOT_Y
	sge	$v0, $t0, 20	# return (y >= 20)
	j	od_done

od_initial_entry:
	lw	$t0, BOT_Y
	sge	$v0, $t0, 60	# return (y >= 60)
	j	od_done
	
od_stop:
	sw	$zero, VELOCITY
	j	od_yes
	
od_goto_tile:
	la	$t0, useful_locations
	add	$t0, $t0, $a1	# &useful_locations[type]
	lbu	$t0, 0($t0)	# tileID = useful_locations[type]
	li	$t1, 15		# width = 15
	div	$t0, $t1
	mflo	$t0		# y = tileID / 15
	mfhi	$t1		# x = tileId % 15
	sll	$t2, $t0, 16	# y << 16
	or	$t2, $t2, $t1	# (y << 16) | x
	sw	$t2, SET_TILE
	bgt	$t0, 2, od_goto_tile_food
	
	lw	$t0, BOT_Y	# make sure we're vertically at the appliance
	bge	$t0, 64, od_no
	li	$t0, 20		# 20 px per tile
	mul	$t1, $t1, $t0
	lw	$t0, BOT_X
	blt	$t0, $t1, od_no
	add	$t1, $t1, 20	# make sure we're not more than 20 px to right of tile
	bgt	$t0, $t1, od_no
	j	od_yes
	
od_goto_tile_food:
	li	$t1, 20		# 20 px per tile
	mul	$t1, $t0, $t1	# y * px
	lw	$t0, BOT_Y
	blt	$t0, $t1, od_no
	add	$t1, $t1, 20	# make sure we're not more than 20 px below top of tile
	bgt	$t0, $t1, od_no
	la	$t0, bin_prox_xs
	lw	$t1, bot_on_left
	sll	$t1, $t1, 2
	add	$t0, $t0, $t1	# &bin_prox_xs[bot_on_left]
	lw	$t0, 0($t0)	# target = bin_prox_xs[bot_on_left]
	lw	$t1, BOT_X
	sub	$t0, $t0, $t1	# margin = target - botX
	bgt	$t0, 3, od_no
	blt	$t0, -3, od_no
	j	od_yes
	
od_goto_app_edge:
	# TODO
	j	od_done

od_boost:
	lw	$t0, TIMER
	add	$t0, $t0, $a1	# when we want it to end
	lw	$t1, boost_end_time
	slt	$v0, $t0, $t1	# true if desired < boost_end_time
	j	od_done
	
od_face_appliance:
	li	$t0, 270
	sw	$t0, ANGLE
	li	$t0, 1
	sw	$t0, ANGLE_CONTROL
	j	od_yes

od_face_bin:
	sw	$zero, VELOCITY
	la	$t0, face_bin_angles
	lw	$t1, bot_on_left
	sll	$t1, $t1, 2
	add	$t0, $t0, $t1	# &face_bin_angles[bot_on_left]
	lw	$t0, 0($t0)	# face_bin_angles[bot_on_left]
	sw	$t0, ANGLE
	li	$t0, 1		# absolute
	sw	$t0, ANGLE_CONTROL
	j	od_yes
	
od_dump:
	sw	$zero, DROPOFF
	li	$t0, 1
	sw	$t0, DROPOFF
	li	$t0, 2
	sw	$t0, DROPOFF
	li	$t0, 3
	sw	$t0, DROPOFF
	j	od_yes
	
od_simple_pickup:
	sw	$zero, PICKUP
	j	od_yes
	
od_goto_counter:
	la	$t0, face_counter_angles
	lw	$t2, bot_on_left
	sll	$t2, $t2, 2
	add	$t0, $t0, $t2	# &face_counter_angles[bot_on_left]
	lw	$t0, 0($t0)	# face_counter_angles[bot_on_left]
	sw	$t0, ANGLE
	li	$t0, 1		# absolute
	sw	$t0, ANGLE_CONTROL
	la	$t0, counter_prox_xs
	add	$t0, $t0, $t2	# &counter_prox_xs[bot_on_left]
	lw	$t0, 0($t0)	# counter_prox_xs[bot_on_left]
	lw	$t1, BOT_X	# x
	sub	$t1, $t1, $t0	# difference between x positions
	bgez	$t1, od_goto_counter_positive
	sub	$t1, $zero, $t1	# negate to get absolute value
od_goto_counter_positive:
	slt	$v0, $t1, 3
	j	od_done
	
od_dropoff:
	sw	$zero, placed_on_appliance
	jal	update_inventory
	la	$t1, inventory
	li	$t0, 3		# i = 3
od_dropoff_loop_top:
	lw	$t2, 12($t1)	# inventory[i]
	bne	$t2, $a1, od_dropoff_loop_next
	sw	$t0, DROPOFF	# drop from index i
	sw	$t2, placed_on_appliance
	j	od_yes
od_dropoff_loop_next:
	beq	$t0, $zero, od_yes
	sub	$t0, $t0, 1	# i--
	sub	$t1, $t1, 4	# update address
	j	od_dropoff_loop_top
	
od_process:
	lw	$t0, placed_on_appliance
	beq	$t0, $zero, od_yes
	lw	$t0, GET_TILE_INFO
	slt	$v0, $a1, $t0
	j	od_done
	
od_load_up:
	sw	$zero, PICKUP
	sw	$zero, PICKUP
	sw	$zero, PICKUP
	sw	$zero, PICKUP	# assumes we have enough money
	j	od_yes
	
od_process_asap:
	lw	$t0, GET_TILE_INFO
	bgt	$t0, $a1, od_yes
	lw	$t0, GET_MONEY
	blt	$t0, 13, od_no
	sw	$zero, FINISH_APPLIANCE_INSTANT
	j	od_yes

od_yes:
	li	$v0, 1
	j	od_done
	
od_no:
	li	$v0, 0
	# fall through to done
	
od_done:
	lw	$ra, 0($sp)
	add	$sp, $sp, 4
	jr	$ra
	
# -----------------------------------------------------------------------
# perform_operation - process an operation queue work item
# $a0: data from queue (low 16 bits)
# $a1: extra data
# -----------------------------------------------------------------------
	
perform_operation:
	sub	$sp, $sp, 4
	sw	$ra, 0($sp)

	la	$t0, po_jump_table
	sll	$t1, $a0, 2	# [i]
	add	$t0, $t0, $t1	# address in jump table to load
	lw	$t0, 0($t0)	# subfunction address
	jr	$t0
	
po_initial_down:
	li	$t0, 10
	sw	$t0, VELOCITY	# start moving
	lw	$t0, TIMER
	li	$t1, 5000
	sll	$t1, $t1, 2	# cycles = 20000
	add	$t0, $t0, $t1
	sw	$t0, TIMER
	j	po_done
	
po_initial_entry:
	lw	$t0, bot_on_left
	sll	$t0, $t0, 2
	la	$t1, entry_angles
	add	$t1, $t1, $t0	# &entry_angles[bot_on_left]
	lw	$t1, 0($t1)
	sw	$t1, ANGLE
	li	$t0, 1		# turn
	sw	$t0, ANGLE_CONTROL
	li	$t0, 10
	sw	$t0, VELOCITY
	lw	$t0, TIMER
	li	$t1, 9000
	sll	$t1, $t1, 2	# cycles = 36000
	add	$t0, $t0, $t1
	sw	$t0, TIMER
	j	po_done
	
po_goto_tile:
	la	$t0, useful_locations
	add	$t0, $t0, $a1	# &useful_locations[type]
	lbu	$t0, 0($t0)	# useful_locations[type]
	li	$t1, 15		# width = 15
	li	$t2, 20		# 20 px per tile
	div	$t0, $t1
	mflo	$a1		# target_y
	mfhi	$a0		# target_x
	mul	$a1, $a1, $t2
	beq	$a1, 40, pb_goto_tile_appliance
	
	la	$t0, bin_xs
	lw	$t1, bot_on_left
	sll	$t1, $t1, 2
	add	$t0, $t0, $t1	# &bin_xs[bot_on_left]
	lw	$a0, 0($t0)	# bin_xs[bot_on_left]
	add	$a1, $a1, 10	# target the middle (not the top)
	j	pb_goto_tile_go
	
pb_goto_tile_appliance:	
	li	$a1, 62		# target the bottom of the appliance (not the top)
	mul	$a0, $a0, $t2
	add	$a0, $a0, 10	# target the middle (not the left)

pb_goto_tile_go:
	jal	set_move_point_target
	li	$t0, 10
	sw	$t0, VELOCITY
	bge	$v0, 10000, pb_goto_tile_short
	srl	$v0, $v0, 1	# "checkpoint" halfway in the middle to correct for arctan inaccuracy
pb_goto_tile_short:
	lw	$t0, TIMER
	add	$t0, $t0, $v0
	sw	$t0, TIMER	# request timer when arrived
	j	po_done
	
po_goto_app_edge:
	# TODO
	j	po_done
	
po_boost:
	lw	$t0, TIMER
	add	$t2, $t0, $a1	# desired end time
	lw	$t1, boost_end_time
	bge	$t1, $t2, po_boost_loop_top
	move	$t1, $t0	# set end time to now (if it was in the past)
po_boost_loop_top:
	blt	$t2, $t1, po_boost_loop_done
	add	$t1, $t1, 10000	# assumes we have enough money
	sw	$zero, GET_BOOST
	j	po_boost_loop_top
po_boost_loop_done:
	sw	$t1, boost_end_time
	j	po_done
	
po_goto_counter:
	# angle set by operation_done
	li	$t0, 10
	sw	$t0, VELOCITY
	j	po_done
	
po_process:
	lw	$t0, TIMER
	add	$t0, $t0, 20000
	sw	$t0, TIMER
	j	po_done
	
po_done:
	lw	$ra, 0($sp)
	add	$sp, $sp, 4
	jr	$ra

# -----------------------------------------------------------------------
# set_move_point_target - sets the target pixel for the SPIMBot to travel to.
# This function assumes there is a direct path from the current location to the target point (no collisions!)
# $a0 - target_x
# $a1 - target_y
# returns the number of cycles needed to move in $v0
# -----------------------------------------------------------------------
set_move_point_target:
        sub         $sp, $sp, 16
        sw          $ra, 0($sp)
        sw          $s0, 4($sp)
        sw          $s1, 8($sp)
        sw          $s2, 12($sp)

        lw          $a2, BOT_X
        lw          $a3, BOT_Y

        sub         $s0, $a0, $a2   # $s0 = current_x - target_x
        sub         $s1, $a1, $a3   # $s1 = current_y - target_y

        jal         euc_dist
        move        $s2, $v0        # s2 = distance

        move        $a0, $s0
        move        $a1, $s1
        jal         sb_arctan       # $v0 = angle to rotate to.
        
        sw          $v0, ANGLE      # set target angle
        li          $t0, 1
        sw          $t0, ANGLE_CONTROL  # and set angle control to absolute

        li	$t0, 1000	# cycles to move one pixel
	mul	$v0, $s2, $t0

        lw          $ra, 0($sp)     #cleanup
        lw          $s0, 4($sp)
        lw          $s1, 8($sp)
        lw          $s2, 12($sp)
        add         $sp, $sp, 16
        jr          $ra
	
# -----------------------------------------------------------------------
# sb_arctan - computes the arctangent of y / x
# $a0 - x
# $a1 - y
# returns the arctangent in $v0
# -----------------------------------------------------------------------
sb_arctan:
        li          $v0, 0           # angle = 0;

        abs         $t0, $a0         # get absolute values
        abs         $t1, $a1
        ble         $t1, $t0, at_no_turn_90

        ## if (abs(y) > abs(x)) { rotate 90 degrees }
        move        $t0, $a1         # int temp = y;
        neg         $a1, $a0         # y = -x;
        move        $a0, $t0         # x = temp;
        li          $v0, 90          # angle = 90;

at_no_turn_90:
        bgez        $a0, at_pos_x    # skip if (x >= 0)

        ## if (x < 0)
        add         $v0, $v0, 180    # angle += 180;

at_pos_x:
        mtc1        $a0, $f0
        mtc1        $a1, $f1
        cvt.s.w     $f0, $f0         # convert from ints to floats
        cvt.s.w     $f1, $f1

        div.s       $f0, $f1, $f0    # float v = (float) y / (float) x;
    
        mul.s       $f1, $f0, $f0    # v^^2
        mul.s       $f2, $f1, $f0    # v^^3
        l.s         $f3, three       # load 3.0
        div.s       $f3, $f2, $f3    # v^^3/3
        sub.s       $f6, $f0, $f3    # v - v^^3/3

        mul.s       $f4, $f1, $f2    # v^^5
        l.s         $f5, five        # load 5.0
        div.s       $f5, $f4, $f5    # v^^5/5
        add.s       $f6, $f6, $f5    # value = v - v^^3/3 + v^^5/5

        l.s         $f8, PI          # load PI
        div.s       $f6, $f6, $f8    # value / PI
        l.s         $f7, F180        # load 180.0
        mul.s       $f6, $f6, $f7    # 180.0 * value / PI

        cvt.w.s     $f6, $f6         # convert "delta" back to integer
        mfc1        $t0, $f6
        add         $v0, $v0, $t0    # angle += delta

        bge         $v0, 0, at_end
        # negative value received.
        li          $t0, 360
        add         $v0, $t0, $v0

at_end:
        jr          $ra
	
# -----------------------------------------------------------------------
# euc_dist - computes the euclidean distance between (x1, y1) and (x2, y2)
# $a0 - x1
# $a1 - y1
# $a2 - x2
# $a3 - y2
# returns the (integer casted) euclidean distance in $v0
# -----------------------------------------------------------------------
euc_dist:
        sub         $a0, $a2, $a0   # $a0 = (x2 - x1)
        mul         $a0, $a0, $a0   # $a0 = (x2 - x1)^2
        sub         $a1, $a3, $a1   # $a1 = (y2 - y1)
        mul         $a1, $a1, $a1   # $a1 = (y2 - y1)^2

        add         $v0, $a0, $a1   # $v0 = (x2 - x1)^2 + (y2 - y1)^2

        mtc1        $v0, $f12       # $f12 = $v0
        cvt.s.w     $f12, $f12      # cast $f12 to a float
        sqrt.s      $f12, $f12      # $f12 = sqrt($f12)
        cvt.w.s     $f12, $f12      # cast $f12 to an int
        mfc1        $v0, $f12       # $v0 = $f12
        jr          $ra
	
	
# -----------------------------------------------------------------------
# update_inventory - updates the "inventory" block in the .data segment
# -----------------------------------------------------------------------
update_inventory:
        la          $t0, inventory
        sw          $t0, GET_INVENTORY
        jr          $ra
	
# -----------------------------------------------------------------------
# request/order/counter encoding and decoding functions
# -----------------------------------------------------------------------

# decode_request turns two ints (packed request) into a 12-long int array
# $a0: request low word
# $a1: request high word
# $a2: result array base address

.globl decode_request
decode_request:
	li	$t0, 0
	
dr_first_loop:
	bge	$t0, 6, dr_intermediate_bits
	and	$t1, $a0, 0x1f		# array[i] = lo & 0x0000001f;
	mul	$t2, $t0, 4		# Calculate array[i]
	add	$t3, $a2, $t2
	sw	$t1, 0($t3)		# Save array[i]
	srl	$a0, $a0, 5		# lo = lo >> 5;
	add	$t0, $t0, 1
	j	dr_first_loop
	
dr_intermediate_bits:
	sll	$t0, $a1, 2		# unsigned upper_three_bits = (hi << 2) & 0x0000001f;
	and	$t0, $t0, 0x1f
	or	$t0, $t0, $a0		# array[6] = upper_three_bits | lo;
	sw	$t0, 24($a2)
	srl	$a1, $a1, 3		# hi = hi >> 3;
	
	li	$t0, 7
	
dr_second_loop:
	bge 	$t0, 12, dr_end		# for (int i = 7; i < 12; ++i)
	and	$t1, $a1, 0x1f		# array[i] = hi & 0x0000001f;
	mul	$t2, $t0, 4		# Calculate array[i]
	add	$t3, $a2, $t2
	sw	$t1, 0($t3)		# Save array[i]
	srl	$a1, $a1, 5		# hi = hi >> 5;
	add	$t0, $t0, 1
	j	dr_second_loop
	
dr_end:
	jr	$ra
	
# decode_request_in_mem unpacks a request from memory into an ingredient array in memory
# $a0: base address of request structure
# $a1: result array base address

.globl decode_request_in_mem
decode_request_in_mem:
	move	$a2, $a1	# result address
	lw	$a1, 4($a0)	# high - documentation is a lie
	lw	$a0, 0($a0)	# low
	j	decode_request	# will use current $ra
	
# create_request turns an array of 12 ingredient counts (words) into a two-word (packed) request
# $a0: array base address
# $v0: low word of result
# $v1: high word of result
	
.globl create_request
create_request:
	lw	$v0, 24($a0)	# unsigned lo = ((array[6] << 30) >> 30);
	sll	$v0, $v0, 30
	srl	$v0, $v0, 30
	
	li	$t0, 5
cr_first_loop:
	blt 	$t0, 0, cr_second_loop_start	# for (int i = 5; i >= 0; --i) {
	sll	$v0, $v0, 5	# lo = lo << 5;
	mul	$t1, $t0, 4	# Calculate array[i]
	add	$t2, $a0, $t1	
	lw	$t1, 0($t2)	# Load array[i]
	or	$v0, $v0, $t1	# lo |= array[i];
	sub	$t0, $t0, 1
	j	cr_first_loop
	
cr_second_loop_start:
	li	$t0, 12
	li	$v1, 0
	
cr_second_loop:
	ble 	$t0, 7, cr_intermediate_bits	# for (int i = 12; i > 7; --i) {
	mul	$t1, $t0, 4	# Calculate array[i]
	add	$t2, $a0, $t1	
	lw	$t1, 0($t2)	# Load array[i]
	or	$v1, $v1, $t1	# hi |= array[i];
	sll	$v1, $v1, 5	# hi = hi << 5;
	
	sub	$t0, $t0, 1
	j	cr_second_loop
	
cr_intermediate_bits:	
	lw	$t1, 28($a0)	# Load array[7]
	or	$v1, $v1, $t1	# hi |= array[i];
	sll	$v1, $v1, 3	# hi = hi << 3;
	lw	$t1, 24($a0)	# Load array[6]
	srl	$t1, $t1, 2	# (array[6] >> 2)
	or	$v1, $v1, $t1	# hi |= (array[6] >> 2);
	
cr_end:
	jr	$ra
	
# create_request_in_mem packs an ingredients list into a request structure in memory
# $a0: base address of (output) request structure
# $a1: input (unpacked) array base address

.globl create_request_in_mem
create_request_in_mem:
	sub	$sp, $sp, 8
	sw	$ra, 0($sp)
	sw	$s0, 4($sp)	# saves $a0
	
	move	$s0, $a0
	move	$a0, $a1
	jal	create_request
	sw	$v0, 0($s0)	# low
	sw	$v1, 4($s0)	# high
	
	lw	$ra, 0($sp)
	lw	$s0, 4($sp)
	add	$sp, $sp, 8
	jr	$ra